import React from "react";
import "./CardDias.scss";


const CardDias =props=>{
    return(
        <section
        className="card"
        style={{ backgroundImage: `url(${props.img})` }}
      >
          <div className="contenedor-titulo">
          <h1 style={{ color: props.color }}>{props.title}</h1>
        </div>
        </section>
    )

}

export default CardDias;
